import { Typography, Button } from "@material-ui/core";

const AssistanceType = ({ setStep, setFormData }) => {
  return (
    <div align="left">
      <Typography variant="h5">What do you seek?</Typography>
      <Button
        variant="contained"
        onClick={() => {
          setStep(1);
          setFormData("assistanceType", "counseling");
        }}
      >
        Counseling
      </Button>
      <br />

      <Button
        variant="contained"
        color="primary"
        onClick={() => {
          setStep(1);
          setFormData("assistanceType", "guidance");
        }}
      >
        Legal Guidance
      </Button>
      <br />

      <Button
        variant="contained"
        color="secondary"
        onClick={() => {
          setStep(1);
          setFormData("assistanceType", "action");
        }}
      >
        Legal Action
      </Button>
    </div>
  );
};

export default AssistanceType;
